import Menu from './Menu';
import Footer from './Footer';
import data from '../data/data.json';





const ProjectBanner = () => {
    return (
        <div className='project_banner'>
            {data.map}
        </div>
    ); 
}; 

const ProjectPage = () => {
    return (
        <div>
            <Menu />
            <ProjectBanner />
            <Footer />
        </div>
    );
};

export default ProjectPage;
